import React from 'react';
import { FaRegTrashAlt } from "react-icons/fa";


function ToDo(props) {
    
    return (
        <div className='task'>
            <button
                
            >
                <FaRegTrashAlt />
            </button>
            <input type='checkbox' />
            <li>
                {props.text}
            </li>
        </div>
    )
}

export default ToDo
